textOriginal:
Alguém aí sabe quem roubou?? Eu não sei. Mas tenho um palpite, vou dar as dicas: 
1 Ele tem nove dedos;
2 foi preso por corrupção;
3 mente descaradamente;
4 lavou dinheiro;
5 apoia ditaduras;
6 limpou os cofres do Brasil;
7 mandou o dinheiro do povo pra outros países;
8 ex presidiário;
9 chefe de facção criminosa;
10 corrupto. Alguém sabe ???
